import Foundation
import FirebaseFirestore

public struct Metadata {
    
    public static func updateAllUnitData() {
        Metadata.deleteUnitData {
            Metadata.createUnitData()
        }
    }
    
    private static func deleteUnitData(completion: @escaping () -> Void) {
        let db = Firestore.firestore()
        db.collection("units").getDocuments { (snapshot, error) in
            if let error = error {
                log.error("Error getting documents: \(error)")
            } else {
                let units = snapshot!.documents.compactMap(Unit.init)
                units.forEach {
                    db.collection("units").document($0.key).delete()
                }
                completion()
            }
        }
    }
    
